export function Sharing(){
    return(
        <div className='flex flex-col mt-4 base_font text-[12px] px-4 space-y-4'>
            <div className='flex flex-col'>
                <p className='font-bold text-[14px]'>민감정보 및 고유식별정보의 처리에 관한 사항</p>
                <p>당사 및 당사 업무수탁자는 「개인정보보호법」및「신용정보의 이용 및 보호에 관한 법률」에 따라 상기의 개인(신용)정보에 대한 개별 동의사항에 대하여 다음과 같이 귀하의 민감정보(피보험자의 질병·상해에 관한 정보(진료기록, 상병명, 기왕증, 흡연 여부 등), 교통사고ㆍ교통법규위반정보) 및 고유식별정보(주민등록번호 · 외국인등록번호)를 처리(수집 · 이용, 조회, 제공)하고자 합니다.</p>
            </div>
        </div>
    )
}
